ute(Number) //设置 分。0 到 59\n// 类似的用法\nmoment().hour() // 小时\nmoment().date() // 一个月里的第几天\nmoment().day() // 星期几\nmoment().dayOfYear() // 一年里的第几天\nmoment().week() // 一年里的第几周\nmoment().month() // 第几个月\nmoment().quarter() // 一年里的第几个季度\nmoment().year() // 年\nmoment().daysInMonth() // 当前月有多少天\n```\n\n## 操作\n```js\nmoment().add(7, 'days') // 之后的第7天。第2个参数还可以是 'months', 'years' 等。注意是复数。\nmoment().add(7, 'd'）// 与上面一行代码的运行结果一样。\nmoment().subtract(1, 'months') // 上个月\n\nmoment().startOf('week') // 这周的第一天\nmoment().startOf('hour') // 等效与 moment().minutes(0).seconds(0).milliseconds(0)。\n// 还支持 'year'，'month' 等\n\nmoment().endOf('week')\n```\n\n## 查询\n```js\n// 早于\nmoment('2010-10-20').isBefore('2010-10-21') // true\nmoment('2010-10-20').isBefore('2010-12-31', 'year') // false\nmoment('2010-10-20').isBefore('2011-01-01', 'year') // true\n\n// 是否相等\nmoment('2010-10-20').isSame('2010-10-20') // true\nmoment('2010-10-20').isSame('2009-12-31', 'year')  // false\nmoment('2010-10-20').isSame('2010-01-01', 'year')  // true\n\n// 晚于\nmoment('2010-10-20').isAfter('2010-10-19') // true\nmoment('2010-10-20').isAfter('2010-01-01', 'year') // false\nmoment('2010-10-20').isAfter('2009-12-31', 'year') // true\n\n// 是否在时间范围内\nmoment('2010-10-20').isBetween('2010-10-19', '2010-10-25') // true\nmoment('2010-10-20').isBetween('2010-01-01', '2012-01-01', 'year') // false\nmoment('2010-10-20').isBetween('2009-12-31', '2012-01-01', 'year') // true\n\nmoment().isLeapYear() // 是否是闰年\n\n```"),_parameters)};var _parameters,Main=function(){return{methods:{moment:moment_default.a},template:'\n<div>\n  <a href="https://momentjs.com/docs/">官网</a> <br>\n  当前时间: {{moment()}}\n</div>\n'}};Main.story={name:"创建"};var Format=function(){return{methods:{moment:moment_default.a},template:"\n<div>\n  年月日 时:分:秒: {{moment().format('YYYY年MM月DD日 HH:mm:ss')}}\n</div>\n"}};Format.story={name:"格式化"};var ToDate=function(){return{methods:{moment:moment_default.a},template:"\n<div>\n   {{moment().toDate()}}\n</div>\n"}};ToDate.st